import React, { useState } from 'react';
import './Navbar.css';
import { NavLink } from 'react-router-dom'

const Navbar = () => {
    const [isNavExpanded, setIsNavExpanded] = useState(false)
    return (
        <nav className='navigate'>
            <a href='/' className='name'>Name</a>
            <button className="menu-btn" onClick={() => {
                setIsNavExpanded(!isNavExpanded)
            }}>
                {
                    isNavExpanded ? <i class="fa-solid fa-xmark"></i> : <i class="fa-solid fa-bars"></i>
                }
            </button>
            <div className={
                isNavExpanded ? "menu expanded" : "menu"
            }>
                <ul>
                    <li><NavLink to='/' className='links' activeClassName='active'><i class="fa-brands fa-facebook-f" />Home</NavLink></li>
                    <li><NavLink to='/Events' className='links' activeClassName='active'>Events</NavLink></li>
                    <li><NavLink to='/Registration' className='links' activeClassName='active'>Registration</NavLink></li>
                </ul>
            </div>
        </nav>
    )
}

export default Navbar
